import React from "react";
import books from './data';

function Card(){
    return (
            <div className="Card">
                {books.map((elm, index)=>(
                    <div key={index}>
                        <img src={elm.image} alt="pic" className="card_img"/>
                        <div className="card_detail">
                            <h2 className="card_title">{elm.title}</h2>
                            <p className="card_author">{elm.author}</p>
                            <a href={elm.website} target="blank">
                                <button>Buy Now</button>
                            </a>
                        </div>    
                    </div>
                    ))};  
            </div>
    )
  };

  export default Card;
